import React from "react";
import './Skill.css';
import backgroundimage1 from '../assets/image1.PNG';
function Skill()
{
    const backgroundImageStyle1={
        backgroundImage:`url(${backgroundimage1})`,
        backgroundRepeat: 'no-repeat',
        backgroundPosition:'left'
      };
    return(
        <div className="y" style={backgroundImageStyle1}>
            <div className="r">
            <h3>What I do</h3>
            <h5>Dedicated Front End Developer Who Want to explore every tech stack</h5>
            <p><img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQh20bNEAgEzd4CosrpqSLCxJX-5MKAR7yKHw&s" alt="loading.." id="h"/><img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRTU1sEw07cPOSjZq-OB68grO0nGL0MnwCWzQA1LfuRZWElkQwHKg4txlVCOl-My6yY5bY&usqp=CAU" alt="loading.." id="h"/></p>
            </div>
        </div>
    );
}
export default Skill;
